import React, {useState} from 'react'

function Cups () {
    const [cups, setCups] = useState('');

  const generarCups = () => {
    // Aquí iría la lógica para generar el CUPS
    const nuevoCups = 'ES1234123412341234AB'; // Esto es solo un placeholder
    setCups(nuevoCups);
  };

  return (
    <div className="App">
      <header className="App-header">
        {cups && <p>CUPS Generado: {cups}</p>}
        <button onClick={generarCups}>Generar CUPS</button>

      </header>
    </div>
  );
}

export default Cups;
